import * as React from 'react';
import PropTypes from 'prop-types';

const TextField = (props) => {
  const { value, error, disabled } = props;

  return (
    <div>
      <h3><b>This is Disabled Input</b></h3>
      <input type="text" value={value} size="32" disabled />
      <h3><b>A Valid Input</b></h3>
      <input type="text" value={value} disabled={disabled} size="32" />
      <h3><b>An Input with errors</b></h3>
      <input type="text" value={value} disabled={disabled} size="32" />
      <div>
        {error}
      </div>
    </div>
  );
};

TextField.propTypes = {
  value: PropTypes.string.isRequired,
  error: PropTypes.string.isRequired,
  disabled: PropTypes.string.isRequired,
};
export default TextField;
